import React from "react";
import { NavLink } from "react-router-dom";

import "../CSS/matchSelector.css";
import { useNavigate } from "react-router-dom";

function RankTypeSelector(props) {
  const history = useNavigate();

  const handleCompareClick = () => {
    history.push("/compare");
  };

  return (
    <div>
      <br />
      <div className="row">
        <div className="col-1"></div>
        <div className="col-3" style={{ marginTop: "10px" }}>
          <NavLink to="/stats">
            <h6 className="">All</h6>
          </NavLink>
        </div>
        <div className="col-3" style={{ marginTop: "10px" }}>
          <NavLink to="/compare" onClick={handleCompareClick}>
            <h6 className="">Compare</h6>
          </NavLink>
        </div>
        <div className="col-3">
          <NavLink to="/rank">
            <h6 className="tab">Rank</h6>
          </NavLink>
        </div>{" "}
      </div>
    </div>
  );
}

export default RankTypeSelector;
